import {
  Component,
  Prop,
  Vue,
} from 'vue-property-decorator';
import emptyImage from './emptyimage';

@Component
export default class Empty extends Vue {
  name: string = 'Empty';

  emptyImage: string = emptyImage;

  @Prop(String) private image!: string;

  @Prop(Object) private imageStyle!: object;
}
